import React from 'react';
import { Link, Route } from 'react-router-dom';
import { default as Introductions } from '../Lecture/Introductions';

class Lecture extends React.Component {
    render() {
        return(
            <div className="Lecture">
                <div>
                    <h1>Lecture</h1>
                    <ul>
                        <li><Link to="/">Home</Link></li>
                    </ul>
                </div>
                <div>
                    <ol>
                        <li><Link to="/Introductions">Introductions</Link>
                        </li>
                    </ol>
                    <Route path={`${match.url}/:id`} component={Introductions}/>
                </div>
            </div>
        );
    }
}

export default Lecture;
